import React from "react";
import { Table } from "react-bootstrap";

function Tabla() {
  let contenido = (
    <tr>
      <th>Pos</th>
      <th>Pos</th>
      <th>Pos</th>
      <th>Pos</th>
      <th>Pos</th>
    </tr>
  );
  return (
    <Table>
      <thead>
        {contenido}
      </thead>

      <tbody>
        <tr>
          <td>1</td>
          <td>2</td>
          <td>3</td>
          <td>4</td>
          <td>5</td>
        </tr>
      </tbody>
    </Table>
  );
}

export default Tabla;
